<p><hi rend="bold">جېڭجۇ شەھىرى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭگو">جۇڭگو</ref> <ref target="https://ug.wikipedia.org/wiki/خېنەن_ئۆلكىسى">خېنەن ئۆلكىسى</ref> دىكىبىخاھار 20067 نوپۇس بار، جېڭجۇنىڭ 7،243،000 نوپۇسىبار، 972.7 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 34.45°، خارىكى ئۇزۇنلۇك 113°38، پوقتانومۇرى 450000 رايۇننومۇرى 371.</p>
